import { Route, Routes } from 'react-router';
import './App.css';
import LandingPage from './components/landing-page/landing';
import Navbar from './components/navbar';
import ViewCans from './components/view-cans/index';

function App() {
	return (
		<Routes>
			{/* <div className="App">
      <h1>Henry Dogs</h1>
    </div> */}
			<Route path="/" element={<LandingPage />} />
			<Route path="/app" element={<Navbar />}>
				<Navbar>
				<Routes>
				<Route exact path=":xd" element={<ViewCans />} />
				</Routes>
				</Navbar>
			</Route>
		</Routes>
	);
}

export default App;
